            <article>
                <p>Web je koncipovaný ako eshop z oblečením a blog dokopy. Na webe sú všetky klasické funkcie ktoré sa od eshopu očakávajú(kategórie, detaily produktov, košík, platba, rozhranie účtu, atď.) taktiež ale špecifické funkcie, ktoré boli súčasťou zadania. Tento projekt bol môj prvý veľký projekt na zákazku a preto ho považ");
            WriteLiteral(@"ujem za najväčšiu ukážku svojich schopností. </p>
